  React.useEffect(() => {
    fetchData()
  }, [])

  const fetchData = async () => {
    try{
      const data = await fetch('/mainPage');
      const dataItems =  await data.json();
    } catch {
      console.log()
    }
  }
  return <div>Main Page Vibes</div>
}

export default MainPage
